import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTimes } from '@fortawesome/free-solid-svg-icons';
export default function Todos(props) {
console.log(props.props[0].id)


    function d({todo}){
        if (todo.id){
            console.log("ok")
        } else {
            console.log("no ok")
        }


    }



  return (
    <div style={{marginLeft: "300px", backgroundColor: "#9e9b9b", maxWidth: "150px"}}>
        {props.props.map(todo => (
            <label style={{display: "flex", border: "#000000 solid 2px"}}>
                <input type="checkbox"/>
                <p key={todo.id} onClick={d}>
                    {todo.text}
                    <FontAwesomeIcon icon={faTimes} style={{marginLeft: "80px"}}/> 
                </p>

            </label>
        ))}
    </div>
  )
}
